import { jsPDF } from "jspdf";
export var font =
	"";
var callAddFont = function () {
	this.addFileToVFS("Manrope-VariableFont_wght-normal.ttf", font);
	this.addFont(
		"Manrope-VariableFont_wght-normal.ttf",
		"Manrope-VariableFont_wght",
		"normal"
	);
};
jsPDF.API.events.push(["addFonts", callAddFont]);
